content: >-
  <p class="b"></p><p class="q1"><span data-number="19" data-sid="PSA 89:19"
  class="v">19</span>Then thou spakest in vision to thy holy one, and saidst, I
  have laid help upon <span class="add">one that is</span> mighty; I have
  exalted <span class="add">one</span> chosen out of the people.</p>
